import "./Home.css";

function Home() {
    return (
        <div>
        /* The Pink Part */
            <div class = "pink">
                <h1>COVID-19 <br></br> Protecting System</h1>
                <h2>Destination Finder</h2>
            </div>

            /*The white part*/
            <div class = "white">
                <div class = "line">
                </div>
                <div>
                    <p>This is a web app that takes in the users' location, destination, and gives recommendations on the destinations furthest from COVID test centers</p>
                    <a class="button" href = "/form">Begin</a>

                </div>
            </div>

        /*The image part*/
            <div class = "image">
                <img src = "./homepage.png"></img>

            </div>            

        </div>

    )
}


export default Home;
